// Emproidry.js
import React from 'react';
import './Emproidry.css';
import Navbar from '../Components/Navbar';
import Footer from '../Components/Footer';

function Emproidry(props) {
    const { location } = props;
    const state = location.state || {};
    const { title, cardImage } = state;

    if (!title || !cardImage) {
        // Handle the case where props are not available
        return (
            <div>
                <Navbar />
                <div>Error: Data not available</div>
                <Footer />
            </div>
        );
    }

    return (
        <>
            <Navbar />
            <div className="emp-head">{title}<span> Designs</span></div>
            <div className="container-emp">
                <div className="card-emp">
                    {/* Render your content here */}
                    <p>Lorem ipsum, dolor sit amet consectetur adipisicing elit. Aliquam, eligendi.</p>
                    <a href="Description" className="button">View </a>
                </div>
            </div>
            <Footer />
        </>
    )
}

export default Emproidry;
